import './App.css';
import React ,{ useState} from 'react';
import { BrowserRouter as Router, Route, Routes, Redirect } from 'react-router-dom';
import Navbar from './Components/Common/Header/Navbar';
import HomePage from './Components/HomePage/HomePage';
import Sponsored from './Components/Sponsored/Sponsored';
import Content from './Components/Common/Content/Content'
import Footer from './Components/Common/Footer/Footer';
import Items from './Components/AboutPage/Items/Items';


function App() {
  const [redirectItems, setRedirectItems] = useState(false);
  return (
    <Router>
    <div className="App">
      <Navbar setRedirectItems={setRedirectItems} />
      <Routes>
        <Route path="/" element={<Sponsored />} />
        <Route path="/about" element={<Sponsored />} />
        <Route path="/contacts" element={<Footer />} />
        {redirectItems && <Route path="/items" element={<Items />} />}
        <Route path="/items" element={<Redirect to="/items" />} />
      </Routes>
      <Footer />
    </div>
  </Router>
  );
}

export default App;
